import React from 'react';
import './AccommodationBlock.less';

type AccommodationType = {
  accommodation: {
    id: number,
    price: number,
    description: string,
    title: string,
    floor: number,
    maxFloor: number,
    roomCount: number,
    address: string,
    space: number,
    images:{ src: string }[]
    owner: {
      name: string,
      phoneNumber: string,
    }
  };
};

const AccommodationBlock: React.FC<AccommodationType> = ({ accommodation }: AccommodationType) => {
  const {
    id, price, description, title, floor, maxFloor, roomCount, address, space, images, owner,
  } = accommodation;
  return (
    <div className="accommodation-view">
      <div className="title-block">
        <div>
          {title}
        </div>
        <div>
          {price.toLocaleString()}
          ₽/мес
        </div>
      </div>
    </div>
  );
};

export default AccommodationBlock;
